We need S ⇒ NT93 NT132 over the whole 7‐symbol span.  Notice:

1) DP[1,1] contains NT93 (from t41).  
2) We show DP[2,6] (the span t154…t34) contains NT132 via  
   NT132 → NT47 NT2  
   - DP[7,1]={NT2}.  
   - So it suffices that DP[2,5] contains NT47.  

3) DP[2,5] (span t154,t117,t120,t62,t120) contains NT47 by  
   NT47 → NT26 NT100  
   a) DP[2,3] (t154,t117,t120) contains NT26 by  
      NT26 → NT37 NT125  
      • DP[2,1]={NT37}  
      • DP[3,2] (t117,t120) contains NT125 via NT125 → NT124 NT10 (and DP[3,1]={NT124}, DP[4,1]={NT10}).  
   b) DP[5,2] (t62,t120) contains NT100 via  
      NT100 → NT34 NT99 (DP[5,1]={NT34}, DP[6,1]={NT99}).  

Thus DP[2,5] → NT47, DP[2,6] → NT132, and DP[1,7] → S. Hence the string is in the language.  
