3) NT93 → NT117 NT122 gives the first 21 tokens, with NT117→'t164' matching the first, and NT122→NT41 NT46 matching the remaining 20;  
4) NT46→'t143' matches the 21st token of the prefix, NT41→NT35 NT44 covers tokens 2–20;  
5) NT44→NT94 NT40, with NT40→'t52' matching the 20th, and NT94→'t180' matching the 19th;  
6) The remaining positions 2–18 are handled by NT35→NT73 NT66, NT73→NT93 NT26, etc., each of which can expand so as to pick off one terminal at the left of the segment (via an L‑recursive NT93→'t75' at pos 2, NT26→… for pos 3–…, etc.) and eventually exhaust the segment exactly.

Thus every token in the string can be generated in turn by a sequence of binary splits plus single‐terminal productions, so the grammar does generate the given string.  

